/**
 * @param context android context
 * @param date date to format
 * @return date, with month, day, and year
 */
@SuppressWarnings("nls")
public static String getDateString(Context context, Date date, boolean includeYear) {
  String month =
      DateUtils.getMonthString(date.getMonth() + Calendar.JANUARY, DateUtils.LENGTH_MEDIUM);
  String value;
  String standardDate;
  // united states, you are special
  Locale locale = Locale.getDefault();
  if (arrayBinaryContains(locale.getLanguage(), "ja", "ko", "zh")
      || arrayBinaryContains(locale.getCountry(), "BZ", "CA", "KE", "MN", "US"))
    value = "'#' d'$'";
  else value = "d'$' '#'";
  if (includeYear) value += ", yyyy";
  if (arrayBinaryContains(locale.getLanguage(), "ja", "zh")) {
    standardDate =
        new SimpleDateFormat(value)
            .format(date)
            .replace("#", month)
            .replace("$", "\u65E5"); // $NON-NLS-1$
  } else if ("ko".equals(Locale.getDefault().getLanguage())) {
    standardDate =
        new SimpleDateFormat(value)
            .format(date)
            .replace("#", month)
            .replace("$", "\uC77C"); // $NON-NLS-1$
  } else {
    standardDate = new SimpleDateFormat(value).format(date).replace("#", month).replace("$", "");
  }
  return standardDate;
}

/**
 * Formats the passed log string as a single line. Prefixes the log string with a date stamp if
 * enabled, and adds a newline if enabled.
 *
 * @param record A log record.
 * @return The message string.
 */
@Override
public String format(LogRecord record) {
  StringBuffer buff = new StringBuffer();
  if (this.enableDateStamp) {
    SimpleDateFormat dateFormat = new SimpleDateFormat("MM/dd HH:mm:ss", Locale.US);
    buff.append(dateFormat.format(new Date()));
    buff.append(" ");
  }
  buff.append(record.getMessage());
  if (this.enableNewline) {
    buff.append(System.getProperty("line.separator"));
  }
  return buff.toString();
}

