public TableBuilder rows(Iterable<?> rowObjects) {
  boolean no_format = false;
  boolean no_values = false;
  if (tableQuery != null && tableQuery.options() != null) {
    if (tableQuery.options().contains("no_format")) no_format = true;
    if (tableQuery != null && tableQuery.options().contains("no_values")) no_values = true;
  }

  for (Object rowObject : rowObjects) {
    row();
    for (Column column : tableBuilder.prototype().cols().get()) {
      Object v = null;
      String f = null;
      Function valueFunction = columns.get(column.id().get()).getValueFunction();
      if (!no_values && valueFunction != null) v = valueFunction.map(rowObject);
      Function formattedFunction = columns.get(column.id().get()).getFormattedFunction();
      if (!no_format && formattedFunction != null) f = (String) formattedFunction.map(rowObject);
      else if (v != null) {
        if (column.columnType().get().equals(Table.DATETIME)) f = Dates.toUtcString((Date) v);
        else if (column.columnType().get().equals(Table.DATE))
          f = new SimpleDateFormat("yyyy-MM-dd").format((Date) v);
        else if (column.columnType().get().equals(Table.TIME_OF_DAY))
          f = new SimpleDateFormat("HH:mm:ss").format((Date) v);
        else f = v.toString();
      }

      cell(v, f);
    }
    endRow();
  }

  return this;
}

/**
 * Reporte Encuestas Para Preguntas de Tipo Nmerico, Seleccin y Calificacin
 *
 * @param parametros
 * @param lista
 * @param extension
 * @param nombreJasper
 * @param nombreReporte
 * @throws JRException
 * @throws IOException
 */
public void FillReportEncuesta(
    Map parametros,
    List<Numericas> lista,
    String extension,
    String nombreJasper,
    String nombreReporte)
    throws JRException, IOException {
  SimpleDateFormat sdf = new SimpleDateFormat("yyyyMMdd");
  File file = new File(nombreJasper);
  JasperReport reporte = (JasperReport) JRLoader.loadObject(file);
  JRBeanCollectionDataSource jbs = new JRBeanCollectionDataSource(lista);
  JasperPrint jasperPrint = JasperFillManager.fillReport(reporte, parametros, jbs);
  HttpServletResponse httpServletResponse =
      (HttpServletResponse) FacesContext.getCurrentInstance().getExternalContext().getResponse();
  httpServletResponse.addHeader(
      "Content-disposition",
      "attachment; filename=" + nombreReporte + "_" + sdf.format((new Date())) + "." + extension);

  ServletOutputStream servletOutputStream = httpServletResponse.getOutputStream();

  if ("PDF".equals(extension)) {
    JasperExportManager.exportReportToPdfStream(jasperPrint, servletOutputStream);
  } else {
    httpServletResponse.setContentType("application/vnd.ms-excel");
    JRXlsExporter xlsxExporter = new JRXlsExporter();
    xlsxExporter.setParameter(JRExporterParameter.JASPER_PRINT, jasperPrint);
    xlsxExporter.setParameter(JRExporterParameter.OUTPUT_STREAM, servletOutputStream);
    xlsxExporter.exportReport();
  }
  FacesContext.getCurrentInstance().responseComplete();
}

