/**
 * Gets a representation of this counter as a string detailing the statistics tracked by this
 * counter.
 *
 * @param useSimpleFormat the flag indicating whether to use a short one-line format, or detailed
 *     statistics including latency bucketing.
 * @return the string representation of this counter.
 */
public String toString(boolean useSimpleFormat) {
  SimpleDateFormat dateFormat = new SimpleDateFormat("HH:mm:ss");
  dateFormat.setTimeZone(TimeZone.getTimeZone("UTC"));
  long elapsedDuration = (this.StartTime == Long.MAX_VALUE) ? 1 : this.EndTime - this.StartTime;
  if (useSimpleFormat)
    return String.format(
        "%8s | Txn.: %,11d%s @ %,11.1f TPS | Lat. = %7d < %7.2f < %7d\n",
        dateFormat.format(new Date(Math.round(elapsedDuration / 1000d) * 1000l)),
        this.cnt,
        this.err > 0 ? String.format(" [!%,11d]", this.err) : "",
        (this.cnt * 1000d / (double) elapsedDuration),
        this.min == 999999999l ? 0l : this.min,
        (double) this.tot / (double) this.cnt,
        this.max == -1l ? 0l : this.max);
  else {
    long[] coarseLat = new long[9];
    // Roll up the latencies below 100ms
    for (int i = 0; i < 4; i++) {
      for (int j = 0; j < 25; j++) {
        coarseLat[i] += this.lat[i * 25 + j];
      }
    }
    // Roll up the rest
    for (int i = 4; i < 8; i++) {
      coarseLat[i] = this.lat[100 + i - 4];
    }
    for (int j = 104; j < this.lat.length; j++) {
      coarseLat[8] += this.lat[j];
    }

    return String.format(
        "-------------------------------------------------------------------------------------\n"
            + "Final: | Txn.: %,11d%s @ %,11.1f TPS | Lat. = %7d < %7.2f < %7d\n"
            + "-------------------------------------------------------------------------------------\n"
            + "Lat.: 25 < 50 < 75 < 100 < 150 < 200 < 250 < 300 < 300+\n"
            + "-------------------------------------------------------------------------------------\n"
            + "%% %6.2f | %6.2f | %6.2f | %6.2f | %6.2f | %6.2f | %6.2f | %6.2f | %6.2f\n",
        this.cnt,
        this.err > 0 ? String.format(" [!%,11d]", this.err) : "",
        (this.cnt * 1000d / elapsedDuration),
        this.min == 999999999l ? 0l : this.min,
        (double) this.tot / (double) this.cnt,
        this.max == -1l ? 0l : this.max,
        100 * (double) coarseLat[0] / this.cnt,
        100 * (double) coarseLat[1] / this.cnt,
        100 * (double) coarseLat[2] / this.cnt,
        100 * (double) coarseLat[3] / this.cnt,
        100 * (double) coarseLat[4] / this.cnt,
        100 * (double) coarseLat[5] / this.cnt,
        100 * (double) coarseLat[6] / this.cnt,
        100 * (double) coarseLat[7] / this.cnt,
        100 * (double) coarseLat[8] / this.cnt);
  }
}

/**
 * Call a restful webservice to get the total daylighthours based on the latitude and longitude
 *
 * @param latitude
 * @param longitude
 * @return daylighthours
 */
private double getDayLightHours(double latitude, double longitude) {
  Client client = new Client();
  try {

    WebResource webResource =
        client.resource(
            "http://www.earthtools.org/sun/" + latitude + "/" + longitude + "/22/4/0/0");
    client.setConnectTimeout(3000);
    client.setReadTimeout(3000);

    com.sun.jersey.api.representation.Form input = new Form();

    // send HTTP POST
    ClientResponse response = webResource.type("text/xml").post(ClientResponse.class, input);

    String output = response.getEntity(String.class);

    String sunrise =
        output.substring(output.indexOf("<sunrise>") + 9, output.indexOf("</sunrise>"));
    String sunset = output.substring(output.indexOf("<sunset>") + 8, output.indexOf("</sunset>"));

    System.out.println("sunrise: " + sunrise);
    System.out.println("sunset: " + sunset);

    DateFormat formatter = new SimpleDateFormat("hh:mm:ss");
    Date date1 = formatter.parse(sunrise);
    Date date2 = formatter.parse(sunset);

    // Get msec from each, and subtract.
    long diff = date2.getTime() - date1.getTime();
    double diffInHours = diff / ((double) 1000 * 60 * 60);

    System.out.println("diff: " + diffInHours / 3);

    client.destroy();

    return diffInHours / 2.5;

  } catch (Exception e) {
    client.destroy();
