public static Label createDatestampLabel(
    String wicketId, Date date, TimeZone timeZone, TimeUtils timeUtils) {
  String format = GitBlit.getString(Keys.web.datestampLongFormat, "EEEE, MMMM d, yyyy");
  DateFormat df = new SimpleDateFormat(format);
  if (timeZone == null) {
    timeZone = GitBlit.getTimezone();
  }
  df.setTimeZone(timeZone);
  String dateString;
  if (date.getTime() == 0) {
    dateString = "--";
  } else {
    dateString = df.format(date);
  }
  String title = null;
  if (TimeUtils.isToday(date)) {
    title = timeUtils.today();
  } else if (TimeUtils.isYesterday(date)) {
    title = timeUtils.yesterday();
  } else if (date.getTime() <= System.currentTimeMillis()) {
    // past
    title = timeUtils.timeAgo(date);
  }
  if ((System.currentTimeMillis() - date.getTime()) < 10 * 24 * 60 * 60 * 1000L) {
    String tmp = dateString;
    dateString = title;
    title = tmp;
  }
  Label label = new Label(wicketId, dateString);
  if (!StringUtils.isEmpty(title)) {
    WicketUtils.setHtmlTooltip(label, title);
  }
  return label;
}

/**
 * @param req
 * @param res
 */
public void doGet(HttpServletRequest req, HttpServletResponse res) {
  PreparedStatement dateStatement = null;
  Log log = new Log();
  try {
    Connection con = log.getConnection();
    System.out.println("LOG (dateStatement) = " + this.sqlCommand);
    dateStatement = con.prepareStatement(this.sqlCommand);
  } catch (SQLException e) {
    logger.error(e);
  } catch (LoggerException e) {
    logger.error(e);
  }
  if (dateStatement == null) {
    try {
      log.closeConnection();
      return; // EARLY EXIT: Can not continue processing
    } catch (LoggerException ex) {
      logger.error(ex);
    }
  }
  ResultSet result = null;
  try {
    result = dateStatement.executeQuery();
    TreeSet<Date> set = new TreeSet<Date>();
    SimpleDateFormat sdf = null;
    SimpleDateFormat sdf2 = null;
    if (req.getParameter("formatDisplayed") == null) {
      sdf = new SimpleDateFormat("yyyy-MMM dd");
    } else {
      sdf = new SimpleDateFormat(req.getParameter("formatDisplayed"));
    }
    if (req.getParameter("formatValue") == null) {
      sdf2 = new SimpleDateFormat("yyyy-MM-dd");
    } else {
      sdf2 = new SimpleDateFormat(req.getParameter("formatValue"));
    }
    Timestamp timeStamp = null;
    String stringTmp = null;
    Date d = null;
    while (result.next()) {
      timeStamp = result.getTimestamp(1);
      stringTmp = sdf.format(timeStamp);
      d = sdf.parse(stringTmp);
      set.add(d);
    }
    Object[] stArray = set.toArray();
    StringBuffer time = new StringBuffer();
    res.setContentType("text/xml");
    time.append("<select>");
    time.append("<option value ='0' ></option>\n");
    for (int i = stArray.length - 1; i > -1; i--) {
      time.append(
          "<option value ='"
              + sdf2.format((Date) stArray[i])
              + "' > "
              + sdf.format((Date) stArray[i])
              + "</option>\n");
    }
    time.append("</select >");
    stArray = null;
    res.getWriter().write(time.toString());
    time = null;
  } catch (SQLException e1) {
    e1.printStackTrace();
  } catch (ParseException e) {
    e.printStackTrace();
  } catch (IOException e) {
    e.printStackTrace();
  } finally {
    try {
      if (result != null) {
        result.close();
      }
      if (dateStatement != null) {
        dateStatement.close();
      }
      log.closeConnection();
    } catch (LoggerException ex) {
      logger.error(ex);
    } catch (SQLException se) {
      logger.error(se);
    }
  }
}

