/**
 * Formatter for handling Task start/due/completed dates.
 *
 * @param c
 * @param dtstart
 * @param due
 * @param completed
 * @param as24HourTime
 * @return
 */
public static CharSequence getTodoTimeText(
    Context c,
    AcalDateTime dtstart,
    AcalDateTime due,
    AcalDateTime completed,
    boolean as24HourTime) {

  if (dtstart == null && due == null && completed == null)
    return c.getString(R.string.Unscheduled);

  SimpleDateFormat formatter =
      new SimpleDateFormat(" MMM d, " + (as24HourTime ? "HH:mm" : "hh:mmaa"));

  return (dtstart == null ? "" : c.getString(R.string.FromPrompt) + format(formatter, dtstart))
      + (dtstart != null && due != null ? " - " : "")
      + (due == null ? "" : c.getString(R.string.DuePrompt) + format(formatter, due))
      + (completed != null
          ? (due != null || dtstart != null ? ", " : "")
              + c.getString(R.string.CompletedPrompt)
              + format(formatter, completed)
          : "");
}

