private void initCalendarDisplay() {
  calendarBaseLayer = new JPanel();
  calendarBaseLayer.setLayout(new GridBagLayout());
  calendarBaseLayer.setBackground(new Color(205, 205, 205));

  GridBagConstraints constraints = new GridBagConstraints();
  constraints.anchor = GridBagConstraints.CENTER;
  constraints.insets = new Insets(1, 1, 1, 1);
  constraints.fill = GridBagConstraints.NONE;

  constraints.gridx = 3;
  constraints.gridy = 1;
  constraints.gridheight = 1;
  constraints.gridwidth = 1;
  constraints.weightx = 999;
  constraints.weighty = 1;

  // add labels for weekdays
  for (int i = 0; i < 7; ++i) {
    JButton temp = new JButton(String.valueOf(Day.getByID(i + 1)));
    final int finalI = i;
    temp.addActionListener(
        new ActionListener() {
          @Override
          public void actionPerformed(ActionEvent e) {
            toggleByDayID(finalI);
          }
        });
    calendarBaseLayer.add(temp, constraints);
    constraints.gridx += 2;
  }

  // add time frames
  constraints.gridx = 1;
  constraints.gridy = 3;
  constraints.weighty = 999;
  constraints.weightx = 1;
  constraints.anchor = GridBagConstraints.NORTH;

  SimpleDateFormat sdf = new SimpleDateFormat("HH:mm");
  Date date;
  try {
    date = sdf.parse("07:00");
  } catch (Exception e) {
    RootLogger.getInstance(LoggerNames.MAIN_LOGGER)
        .log("Error creating Table Data", Level.SEVERE, e);
    return;
  }
  for (int i = 0; i < 16; ++i) {
    String timeFrame = sdf.format(date);
    date.setTime(date.getTime() + ONE_HOUR);
    timeFrame += " - " + sdf.format(date);
    JLabel temp = new JLabel(timeFrame);
    timeLabels.add(temp);
    calendarBaseLayer.add(temp, constraints);
    constraints.gridy += 2;
  }

  // create calendar like look
  constraints.gridx = 3;
  constraints.gridy = 3;
  constraints.weighty = 999;
  constraints.anchor = GridBagConstraints.CENTER;
  constraints.fill = GridBagConstraints.BOTH;
  try {
    for (int i = 0; i < 7; ++i) {
      constraints.gridy = 3;
      for (int j = 0; j < 16; ++j) {
        String[] tArray = timeLabels.get(j).getText().split("-");
        TimeFramePanel temp =
            new TimeFramePanel(sdf.parse(tArray[0]), sdf.parse(tArray[1]), Day.getByID(i + 1));
        timeFramePanels.add(temp);
        calendarBaseLayer.add(temp, constraints);
        constraints.gridy += 2;
      }
      constraints.gridx += 2;
    }
  } catch (ParseException e) {
    RootLogger.getInstance(LoggerNames.MAIN_LOGGER).log("Error Parsing Times!", Level.SEVERE, e);
    System.exit(-1);
  }
}

public static void outputAPFDToFile(APFD apfd, int techniqueNumber) throws IOException {
  SimpleDateFormat sdf = new SimpleDateFormat("yyyyMMdd_HHmmss");
  String directory = "apfd/" + techniqueNumber + "/";
  String filename = sdf.format(new Date()) + ".txt";

  File dir = new File(directory);
  if (!dir.exists()) {
    dir.mkdirs();
  }

  File file = new File(directory + filename);
  if (!file.exists()) {
    file.createNewFile();
  }
  BufferedWriter bw = new BufferedWriter(new FileWriter(file));
  bw.write(String.valueOf(apfd.calculateAPFD()));
  bw.close();
}

/**
 * Test that setting a person's age correctly sets their birth date and records that this is
 * inexact
 *
 * @throws Exception
 */
@Test
public void shouldSetInexactBirthdateFromAge() throws Exception {
  DateFormat df = new SimpleDateFormat("yyyy-MM-dd");
  Person p = new Person();

  // Test that default values are correct
  assertNull(p.getAge());
  assertFalse(p.isBirthdateEstimated());

  // Test standard case and ensure estimated field is set to true
  p.setBirthdateFromAge(10, df.parse("2008-05-20"));
  assertEquals(p.getBirthdate(), df.parse("1998-01-01"));
  assertTrue(p.getBirthdateEstimated());

  // Test boundary cases
  p.setBirthdateFromAge(52, df.parse("2002-01-01"));
  assertEquals(p.getBirthdate(), df.parse("1950-01-01"));
  p.setBirthdateFromAge(35, df.parse("2004-12-31"));
  assertEquals(p.getBirthdate(), df.parse("1969-01-01"));
  p.setBirthdateFromAge(0, df.parse("2008-05-20"));
  assertEquals(p.getBirthdate(), df.parse("2008-01-01"));
}
